function SidePanel()
{
    return (
        <div class="col-2">
            <input type="checkbox"/> 0-50 <br/>
            <input type="checkbox"/> 50-100
            <input type="checkbox"/> 100-1000
            <input type="checkbox"/> &gt; 1000
        </div>
    )
}

export default SidePanel;
